import React from "react";
import ExpenseItem from "./ExpenseItem";

const ExpensesList = (props) => {
  { if(props)
    props.filteredExpenses.map((expense) => {
      return (
        <ExpenseItem
          key={expense.id}
          title={expense.title}
          amount={expense.amount}
          date={expense.date}
        />
      );
    });
  }
};

export default ExpensesList;
